export const setFlower = (flower) => {
    return {
        type: "setFlower",
        payload: flower
    }
}
export const getFlower = () => {
    return {
        type: "getFlower"
    }
}
export const inBascet = (flower) => {
    return {
        type: "inBascet",
        payload: flower
    }
}
